description:
Борона-мотыга ротационная БР-6 от производителя.

Технические характеристики бороны:
– борона имеет цельную конструкцию (без функции складывания);
– рабочая ширина захвата бороны – 6 м;
– количество рабочих органов составляет 31 шт.;
– количество подшипников на рабочий орган – 8 шт.;
– зуб рабочего органа имеет толщину 8 мм, изготавливается из стали марки 45, конец зуба заклепывается в виде "лопатки" и закаляется посредством ТВЧ;
– пружина рабочего органа имеет 21 виток, изготавливается из пружинной стали и работает на растяжение (аналогичная конструкция используется на боронах John Deere);
– в конструкции рабочего органа используется литая ступица собственного производства.

Гарантия на агрегат – 12 месяцев.
Любая форма оплаты (наличный, безналичный расчет).
Доставка агрегата осуществляется нашим собственным транспортом либо транспортным компаниями в любую точку Украины.

Звоните! Будем рады ответить на все интересующие Вас вопросы.

Снегоуборочные отвалы ВС-2.5М от производителя.

Наши отвалы агрегатируются с тракторами МТЗ, ЮМЗ, Т-40.

Отвал поставляются в комплекте с технической пластиной толщиной 40 мм.

Технические характеристики отвала:
– катанная цельнометаллическая лопата;
– П-образная рамка отвала;
– ширина лопаты – 2,5 м;
– высота лопаты – 0,8 м;
– толщина метала лопаты – 4 мм;
– механический поворот на три стороны (право, лево, центр);
– угол поворота лопаты – 30°;
– гидроцилиндр на подъем-опускание лопаты.

Гарантия на агрегат – 12 месяцев.
Любая форма оплаты (наличный, безналичный расчет).
Отправка агрегата осуществляется службами доставки (Новая Почта, Деливери, Ночной Экспресс, САТ) либо нашим собственным транспортом в любую точку Украины.

Звоните! Будем рады ответить на все интересующие Вас вопросы.

Загрузчик шнековый ЗШП-9 от производителя.

Особенности шнекового загрузчика нашего производства:
– полная длина погрузчика составляет 9 м;
– максимальна высота выгрузки составляет 6 м;
– производительность агрегата – до 15 т/ч (в зависимости от культуры и угла наклона);
– в конструкции агрегата используется труба диаметром 159 мм и толщиной стенки 3,5 мм;
– толщина витка шнека составляет 2 мм;
– погрузчик установлен на треногу с рельсовым механизмом регулировки высоты и 2-х-скоростной лебедкой;
– на погрузчик установлен электродвигатель 3 кВт/1000 об., который на выходе дает 400 оборотов шнека;
– комплектуется электроящиком, который соответствует всем требованиям безопасности.

Дополнительные опции:
– бункер (съемный или несъемный);
– на выбор клиента устанавливается электродвигатель на 220 или 380 В.

Гарантия на агрегат – 12 месяцев.
Любая форма оплаты (наличный, безналичный расчет).
Доставка агрегата осуществляется нашим собственным транспортом либо транспортным компаниями (Новая Почта, Деливери) в любую точку Украины.

Звоните! Будем рады ответить на все интересующие Вас вопросы.

Загрузчик сеялок ЗС-30М – цена и качество от производителя.

Агрегат поставляется в следующей комплектации:
– выгрузной шнек в коробе;
– борт под автомобиль "ГАЗ/ЗИЛ";
– направляющая гофра с ведром;
– гидроцилиндр;
– гидромотор ГМШ-50 (про-во "Гидросила");
– гидрораспределитель на 3 секции;
– гидрошланги, штуцера, метизы.

Технические характеристики нашего загрузчика:
– производительность – от 15 до 30 т/ч;
– максимальная высота загрузки – до 4,35 м;
– максимальная дальность загрузки – до 2,80 м;
– диаметр трубы составляет 180 мм, шнека – 160 мм.

Гарантия на загрузчики – 12 месяцев.
Любая удобная для Вас форма оплаты (наличный, безналичный расчет).
