Кормораздатчик тракторный универсальный КТУ-10 – это одно из основных средств механизации раздачи кормов на фермах крупного рогатого скота, так как в большинстве фермерских хозяйств до сих пор используется технология раздельного кормления животных со значительными затратами ручного труда.

Особенности кормораздатчика КТУ-10 нашего производства:
– надежный, долговечный, имеет прочный кузов;
– на агрегат устанавливаются усиленные рессоры;
– комплектуется гидроприводными тормозами – это обеспечивает повышенную управляемость и устойчивость агрегата;
– использование усиленных направляющих транспортеров в конструкции агрегата.

Операции, которые выполняются с помощью кормораздатчика КТУ-10:
– транспортировка и дозирование раздачи измельченного корма и смесей животным;
– дозированная подача измельченного корма к средствам загрузки кормохранилищ и внутрифермским стационарным раздатчикам кормов;
– обслуживание навозоуборочных транспортеров и косилок-измельчителей;
– перевозка различных грузов с выгрузкой назад.

Гарантия качества – 1 год.

Любая удобная для Вас форма оплаты.

