Звоните! Мы будем рады ответить на все интересующие Вас вопросы.

Данная дисковая борона имеет ширину захвата 3 м и предназначена для агрегатирования с трактором мощностью не менее 80 л.с. Пружинные стойки Bellota с необслуживаемыми упорными подшипниковыми узлами, на которых установлены вырезные диски из борсодержащей стали Ø 460 мм, обеспечивают интенсивное измельчение растительных пожнивных остатков и перемешивание их с грунтом, самоочистку рабочих органов за счет вибрации стоек в процессе работы. Для точной и поверхностной обработки на малую глубину на передний и/или задний ряд стоек могут быть установлены гладкие сферические диски.

Оптимальные горизонтальный и вертикальный углы установки рабочих органов обеспечивают врезание в грунт как при традиционной, так и при минимальной обработке.

Дисковая борона позволяет производить сельскохозяйственные работы на повышенной скорости, что позволяет увеличить производительность при одновременной экономии горюче-смазочных материалов.

Опционально агрегаты серии ЛДП могут комплектоваться:

- вырезными и сферическими дисками Ø 510 мм и 560 мм для улучшения заделывания большого количества пожнивных остатков после уборки высокостебельных культур;

- регулируемыми передними контактными колесами для увеличения стабильности глубины обработки;

- штригельными секциями пружинных зубов для дополнительного измельчения комков почвы при предпосевной обработке;

- прикатывающими шлейф - катками разных типов (планчатым, одинарным или тандемным STS типа, тандем труба-полоса или катком с наборными пружинными секторами);

- прицепным устройством типа САТ.2 для двухточечной навески

Тракторный полуприцеп НТС-5 от производителя.

Технические характеристики полуприцепа:
– стандартная толщина бортов – 3 мм;
– вместимость кузова – 7,0 м³;
– грузоподъемность – 6,5 т;
– выгрузка назад (односторонняя);
– угол выгрузки – 50°.

Если Вы планируете эксплуатировать полуприцеп на дорогах общего пользования, то также возможна помощь с постановкой на учет.

Кроме того, в ассортимент нашей компании входят тракторные прицепы 2ПТС-4 и 2ПТС-6.

Гарантия на агрегат – 12 месяцев.
Любая форма оплаты (наличный, безналичный расчет).
Доставка агрегата осуществляется нашим собственным транспортом либо транспортным компаниями в любую точку Украины.

