Транспортуючий пристрій для сипких, дрібнокускових, пилоподібних, порошкоподібних матеріалів. Ці транспортери широко використовуються по всьому світу в таких галузях, як виробництво кормів для домашніх тварин, виробництво пластмас, мила, пральних порошків та миючих засобів, виробництво комбікормів, хімічних речовин, а також у деревообробній промисловості, еко-технологіях, виробництві цементу, вапна та гіпсу, гірничодобувної промисловості.

Технічні характеристики: Шнековий транспортер у лотку (жолобі) 200 мм довжиною 3 метри
Продуктивність 30 т/годину;
Діаметр лотка 200 мм;
Товщина лотка від 2 до 4 мм;
Діаметр шнекової спіралі 180 мм;
Довжина 3 м;
Товщина спіралі від 2 до 6 мм;
Електродвигун 3,0 кВт (380В)

Можливе виготовлення навантажувачів за Вашими кресленнями з урахуванням Ваших виробничих завдань.

